/**
 * Construct a vertical plane through a specified
 * x, y and origin.
 *
 * @param x is the specified x value.
 * @param y is the specified y value.
 */
public Plane(final double x, final double y) {
  super(y, -x, 0.0);
  D = 0.0;
}

